import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';  // <-- import this
import DriverProfile from './DriverProfile';

const DriverLanding = () => {
  const [showProfile, setShowProfile] = useState(false);
  const navigate = useNavigate();  // <-- get navigate function

  const handleLogout = () => {
    localStorage.clear();
    navigate('/role-selection'); // Redirect to RoleSelection page route
  };

  return showProfile ? (
    <>
      <button
        className="absolute top-4 left-4 text-black px-3 py-1 text-sm rounded-md font-semibold shadow-sm hover:bg-gray-200 transition z-50 whitespace-nowrap"
        onClick={() => setShowProfile(false)}
      >
        Back
      </button>
      <DriverProfile />
    </>
  ) : (
    <div className="min-h-screen bg-brandOrange flex items-center justify-center p-6 relative">
      <button
        className="absolute top-4 right-4 bg-red-500 text-white px-3 py-1 rounded-md hover:bg-red-600 transition"
        onClick={handleLogout}
      >
        Logout
      </button>
      {/* ... rest of your landing page content */}
      <div className="w-full max-w-7xl">
        <h6 className="text-center text-4xl font-bold text-black mb-4">
          Hello {localStorage.getItem("fullName") || "User"}
        </h6>
        {/* ... other content */}
      </div>
    </div>
  );
};

export default DriverLanding;
